function remove_fields(link){$(link).prev("input[type=hidden]").val("1");$(link).closest(".fields").hide();}
function add_fields(link,association,content){var new_id=new Date().getTime();var regexp=new RegExp("new_"+association,"g");$(link).parent().before($("<div />").html(content.replace(regexp,new_id)).text());}
function loadjscssfile(filename,filetype){if(filetype=="js"){var fileref=document.createElement('script')
fileref.setAttribute("type","text/javascript")
fileref.setAttribute("src",filename)}
else if(filetype=="css"){var fileref=document.createElement("link")
fileref.setAttribute("rel","stylesheet")
fileref.setAttribute("type","text/css")
fileref.setAttribute("href",filename)}
document.getElementsByTagName("head")[0].appendChild(fileref)}
